  import React from 'react'
  import { MDXTag } from '@mdx-js/tag'


export default class MDXContent extends React.Component {
  constructor(props) {
    super(props)
    this.layout = null
  }
  render() {
    const { components, ...props } = this.props

    return <MDXTag
             name="wrapper"

             components={components}><MDXTag name="h1" components={components} props={{"id":"c-udemy"}}>{`C++ Udemy`}</MDXTag>
<MDXTag name="h2" components={components} props={{"id":"variables"}}>{`Variables`}</MDXTag>
<MDXTag name="p" components={components}><MDXTag name="strong" components={components} parentName="p">{`Datatypes`}</MDXTag></MDXTag>
<MDXTag name="ul" components={components}>
<MDXTag name="li" components={components} parentName="ul">{`int  `}</MDXTag>
<MDXTag name="li" components={components} parentName="ul">{`short `}</MDXTag>
<MDXTag name="li" components={components} parentName="ul">{`float `}</MDXTag>
<MDXTag name="li" components={components} parentName="ul">{`double `}</MDXTag>
<MDXTag name="li" components={components} parentName="ul">{`char `}</MDXTag>
<MDXTag name="li" components={components} parentName="ul">{`bool`}</MDXTag>
<MDXTag name="li" components={components} parentName="ul">{`also can add `}<MDXTag name="inlineCode" components={components} parentName="li">{`unsigned`}</MDXTag></MDXTag>
</MDXTag>
<MDXTag name="pre" components={components}><MDXTag name="code" components={components} parentName="pre" props={{"className":"language-cpp"}}>{`#include <iostream>

main()
{
    cout << 4 << endl; // endl for endline
    int A = 4;
}
`}</MDXTag></MDXTag>
<MDXTag name="h2" components={components} props={{"id":"getting-input"}}>{`Getting input`}</MDXTag>
<MDXTag name="pre" components={components}><MDXTag name="code" components={components} parentName="pre" props={{"className":"language-cpp"}}>{`#include <iostream>

using namespace std

main() {
    char *example;
    cin >> example;

    cout << "test";
}
`}</MDXTag></MDXTag>
<MDXTag name="h2" components={components} props={{"id":"5-arrays"}}>{`5: Arrays`}</MDXTag>
<MDXTag name="pre" components={components}><MDXTag name="code" components={components} parentName="pre" props={{"className":"language-cpp"}}>{`main() 
{
    int arr[3] = {3,4,5};
    for (int i=0; i < 3; i++) {
        cout << arr[i] << endl;
    }
}
`}</MDXTag></MDXTag>
           </MDXTag>
  }
}
